import React from 'react';
import Header from './components/Header';
import ProductDetails from './components/ProductDetails';
import SalesGraph from './components/SalesGraph';
import SalesTable from './components/SalesTable';

function App() {
  return (
    <div>
      <Header />
      <ProductDetails />
      <SalesGraph />
      <SalesTable />
    </div>
  );
}

export default App;
